a, Georgia, on the night of May 30. Police officers approached the car, broke windows, pulled the students out, and tased Young. One of the officers involved said he used his Taser because he thought the students might be armed.\\n\\nFor more, follow NowThis News.\\n\\n#GeorgeFloyd #Protests #Atlanta #News #NowThis #NowThisNews\\n\\nConnect with NowThis\\n» Like us on Facebook: http:\/\/go.nowth.is\/News_Facebook\\n» Tweet us on Twitter: http:\/\/go.nowth.is\/News_Twitter\\n» Follow us on Instagram: http:\/\/go.nowth.is\/News_Instagram\\n» Find us on Snapchat Discover: http:\/\/go.nowth.is\/News_Snapchat\\n\\nNowThis is your premier news outlet providing you with all the videos you need to stay up to date on all the latest in trending news. From entertainment to politics, to viral videos and breaking news stories, we’re delivering all you need to know straight to your social feeds. We live where you live.\\n\\nhttp:\/\/www.youtube.com\/nowthisnews\\n@nowthisnews\"},\"lengthSeconds\":\"200\",\"ownerProfileUrl\":\"http:\/\/www.youtube.com\/user\/nowthismedia\",\"externalChannelId\":\"UCn4sPeUomNGIr26bElVdDYg\",\"isFamilySafe\":true,\"availableCountries\":[\"AD\",\"AE\",\"AF\",\"AG\",\"AI\",\"AL\",\"AM\",\"AO\",\"AQ\",\"AR\",\"AS\",\"AT\",\"AU\",\"AW\",\"AX\",\"AZ\",\"BA\",\"BB\",\"BD\",\"BE\",\"BF\",\"BG\",\"BH\",\"BI\",\"BJ\",\"BL\",\"BM\",\"BN\",\"BO\",\"BQ\",\"BR\",\"BS\",\"BT\",\"BV\",\"BW\",\"BY\",\"BZ\",\"CA\",\"CC\",\"CD\",\"CF\",\"CG\",\"CH\",\"CI\",\"CK\",\"CL\",\"CM\",\"CN\",\"CO\",\"CR\",\"CU\",\"CV\",\"CW\",\"CX\",\"CY\",\"CZ\",\"DE\",\"DJ\",\"DK\",\"DM\",\"DO\",\"DZ\",\"EC\",\"EE\",\"EG\",\"EH\",\"ER\",\"ES\",\"ET\",\"FI\",\"FJ\",\"FK\",\"FM\",\"FO\",\"FR\",\"GA\",\"GB\",\"GD\",\"GE\",\"GF\",\"GG\",\"GH\",\"GI\",\"GL\",\"GM\",\"GN\",\"GP\",\"GQ\",\"GR\",\"GS\",\"GT\",\"GU\",\"GW\",\"GY\",\"HK\",\"HM\",\"HN\",\"HR\",\"HT\",\"HU\",\"ID\",\"IE\",\"IL\",\"IM\",\"IN\",\"IO\",\"IQ\",\"IR\",\"IS\",\"IT\",\"JE\",\"JM\",\"JO\",\"JP\",\"KE\",\"KG\",\"KH\",\"KI\",\"
